Heating Up the Holidays - 3-Story Bundle/Anthology


Format: mobi/epub
Genre: Contemporary Romance
Date: 28 October 2013

Heating Up the Holidays features three sexy holiday novellas, each one centered on a different holiday: Thanksgiving, Christmas, and New Year. With stories from bestselling author Lisa Renee Jones, the popular Mary Ann Rivers, and Loveswept debut author Serena Bell.

